column8:
トレンドのローファーパンプスに春夏らしいニューカラーが登場しました。とてもシンプルでかつオシャレでカッコいい雰囲気。さっと履けて、コーディネートに取り入れやすいローファーに脱ぎ履きしやすいサイドゴアデザインに仕上げ、ヒールにはきらりと光るメタリックラインが大人っぽく、きれいめにも履けるデザインにしました。カジュアルなイメージのローファーですが、デイリーはもちろん、あらたまった席やお出かけにもおすすめです。 
<br>
<br>



<br><br>




